import{_ as e,c as t,o as i,a as o}from"./app.ad4e2cff.js";const m=JSON.parse('{"title":"\u{1F3E0} Home","description":"Welcome to the developers API home, here you can create apps, plugins and connectors for Twake.","frontmatter":{"description":"Welcome to the developers API home, here you can create apps, plugins and connectors for Twake."},"headers":[{"level":2,"title":"Introduction:","slug":"introduction","link":"#introduction","children":[]},{"level":2,"title":"Ready to use integration:","slug":"ready-to-use-integration","link":"#ready-to-use-integration","children":[]},{"level":2,"title":"Imagination is your limit","slug":"imagination-is-your-limit","link":"#imagination-is-your-limit","children":[]}],"relativePath":"developers-api/home.md"}'),a={name:"developers-api/home.md"},n=o('<h1 id="\u{1F3E0}-home" tabindex="-1">\u{1F3E0} Home <a class="header-anchor" href="#\u{1F3E0}-home" aria-hidden="true">#</a></h1><h2 id="introduction" tabindex="-1">Introduction: <a class="header-anchor" href="#introduction" aria-hidden="true">#</a></h2><p>Twake offer the possibility to uses a lot of application to increase the quality of your team workflow. You can now easily send a Gif to add conviviality into your channels, start Jitsi calls in one click, create polls or even get notified in your channels using webhooks or automation as powerful as n8n allows.</p><h2 id="ready-to-use-integration" tabindex="-1">Ready to use integration: <a class="header-anchor" href="#ready-to-use-integration" aria-hidden="true">#</a></h2><p>Twake have some integrations ready to use that are just waiting for you to be installed in your workspaces. You can find in the list below these integrations:</p><ul><li>Jitsi: <a href="https://github.com/linagora/Twake-Plugins-Jitsi" target="_blank" rel="noreferrer">https://github.com/linagora/Twake-Plugins-Jitsi</a></li><li>Giphy: <a href="https://github.com/linagora/Twake-Plugins-Giphy" target="_blank" rel="noreferrer">https://github.com/linagora/Twake-Plugins-Giphy</a></li><li>SimplePoll: <a href="https://github.com/linagora/Twake-Plugins-SimplePoll" target="_blank" rel="noreferrer">https://github.com/linagora/Twake-Plugins-SimplePoll</a></li><li>Webhoocks: <a href="https://github.com/linagora/Twake-Plugins-Webhooks" target="_blank" rel="noreferrer">https://github.com/linagora/Twake-Plugins-Webhooks</a></li><li>N8n: <a href="https://github.com/linagora/Twake-Plugins-n8n" target="_blank" rel="noreferrer">https://github.com/linagora/Twake-Plugins-n8n</a></li></ul><h2 id="imagination-is-your-limit" tabindex="-1">Imagination is your limit <a class="header-anchor" href="#imagination-is-your-limit" aria-hidden="true">#</a></h2><p>By installing webhooks or n8n in your workspace, you can now imagine infinite uses cases to increase the quality of your team workflow. Connect your channels to get notify of new code changes when pushing on github or to get notify in a n8n workflow. </p><p>If you think that you can&#39;t do something with integration, as Twake is open source, feel free to contribute to an existing Twake&#39;s integration or even more create the new integration that answer to your need. </p><blockquote><p>Please do not work on this list of plugins as we already made them (their are just not yet open-sourced)<br> Zapier, IFTTT, OnlyOffice, RSS feed, Github, Gitlab and Reminder.</p></blockquote><p>\u{1F917} We are not yet ready for this documentation, up this issue to have it sooner : <a href="https://github.com/TwakeApp/Twake/issues/116" target="_blank" rel="noreferrer">https://github.com/TwakeApp/Twake/issues/116</a></p>',11),r=[n];function s(l,h,u,c,g,d){return i(),t("div",null,r)}const f=e(a,[["render",s]]);export{m as __pageData,f as default};
